import React from "react";
import { Card, Col, Row } from "antd";

export default function Home() {
  return (
    <div className="home">
      <Row gutter={24}>
        <Col xs={24} sm={12} md={12} lg={12} xl={12}>
          <Card title="Card title" bordered={false}>
            Card content
          </Card>
        </Col>
        <Col xs={24} sm={12} md={12} lg={12} xl={12}>
          <Card title="Card title" bordered={false}>
            Card content
          </Card>
        </Col>
      </Row>
    </div>
  );
}
